import React from 'react';
import Card from './Card';

const CardList = ({cats}) => {
  const catComponent = cats.map((cat, i) => {
    return <Card id={cats[i].id} name={cats[i].name} loves={cats[i].loves}/>
  });

  return (
    <div>
      <Card id={cats[0].id} name={cats[0].name} loves={cats[0].loves}/>
      <Card id={cats[1].id} name={cats[1].name} loves={cats[1].loves}/>
      <Card id={cats[2].id} name={cats[2].name} loves={cats[2].loves}/>
      <Card id={cats[3].id} name={cats[3].name} loves={cats[3].loves}/>
      <Card id={cats[4].id} name={cats[4].name} loves={cats[4].loves}/>
      <Card id={cats[5].id} name={cats[5].name} loves={cats[5].loves}/>
    </div>
  );
}

export default CardList;
